def generate_prefix_table(pattern: str) -> [int]:
    length = 0
    i = 1
    prefix_table = [0 for c in pattern]

    while i < len(pattern):
        if pattern[i] == pattern[length]:
            length += 1
            prefix_table[i] = length
        else:
            if length != 0:
                length = prefix_table[length - 1]
                i -= 1
            else:
                prefix_table[i] = 0
        i += 1

    return prefix_table


def divisible_string(string: str, pattern: str):
    pattern_length = len(pattern)
    string_length = len(string)

    if string_length % pattern_length != 0:
        return -1

    if pattern * (string_length // pattern_length) != string:
        return -1

    prefix_table = generate_prefix_table(pattern)

    return max(prefix_table)


if __name__ == '__main__':
    # s = 'bcdbcdbcdbcd'
    # t = 'bcdbcd'
    s = "";
    t = "";

    print(divisible_string(s, t))
